const Nav = () => {
    return(
        <header>
            <nav class="navbar bg-body-tertiary">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">
      <img  alt="Logo" width="30" height="24" class="d-inline-block align-text-top" />
      
    </a>
  </div>
</nav>
        </header>
    );
}

export default Nav;
